import { Grid } from "@mui/material";
import * as React from "react";

function Login() {
  return (
    <div>
      <Grid container>
        <Grid
          xs={12}
          sx={{ display: "flex", flexDirection: "row", flexWrap: "wrap" }}
        >
          <div>xs=12</div>
        </Grid>
      </Grid>
    </div>
  );
}
export default Login;
